css:
.ast-view {
  overflow-y: auto;
}
.ast-view .node rect {
  cursor: pointer;
  fill: #fff;
  fill-opacity: .9;
  stroke: black;
  stroke-width: 1.5px;
}
.ast-view .node text {
  font: 11px sans-serif;
  font-weight: bold;
  pointer-events: none;
  fill: white;
}
.ast-view path.link {
  fill: none;
  stroke: #9ecae1;
  stroke-width: 1.5px;
}
